options.rowCallback:
function(row, data, displayNum, displayIndex, dataIndex) {
var value=data[3]; $(this.api().cell(row, 3).node()).css({'text-align':'right'});
var value=data[2]; $(this.api().cell(row, 2).node()).css({'color':'gray'});
var value=data[3]; $(this.api().cell(row, 3).node()).css({'color':'gray'});
}

ajax.data:
function(d) {
d.search.caseInsensitive = true;
d.search.smart = true;
d.escape = false;
var encodeAmp = function(x) { x.value = x.value.replace(/&/g, "%26"); }
encodeAmp(d.search);
$.each(d.columns, function(i, v) {encodeAmp(v.search);});
}

